const BackGround = () => {
  return(
    <Html 
      fullscreen 
      zIndexRange={[-10, 0]}
      calculatePosition={ () => [0, 0, 0] }
      className="Background"
    >
      <header></header>
      <div className="main"></div>
    </Html>
  )
}

export default BackGround;
